interface ProviderIconProps {
  provider?: string;
  className?: string;
}

export const ProviderIcon: React.FC<ProviderIconProps> = ({ provider, className }) => {
  if (!provider) {
    return null;
  }

  const icon = providerIconsMap[provider.toLowerCase()];

  if (!icon) {
    return null;
  }

  return <span className={className}>{icon}</span>;
};
